import React, { useState } from "react";

import { Box, Grid, TextField, Button } from "@material-ui/core";
import HeaderTask from "./../Home/Tasks/HeaderTask";

export default function Profile() {
  const [inputValue, setInputValue] = useState({
    username: "",
    email: "",
    firstName: "",
    lastName: "",
    city: "",
    country: "",
    postalCode: "",
    about: "",
  });

  const listInput = [
    {
      label: "Username",
      value: inputValue.username,
      width: 3,
    },
    {
      label: "Email address",
      value: inputValue.email,
      width: 3,
    },
    {
      label: "First Name",
      value: inputValue.firstName,
      width: 6,
    },
    {
      label: "Last Name",
      value: inputValue.lastName,
      width: 6,
    },
    {
      label: "City",
      value: inputValue.city,
      width: 4,
    },
    {
      label: "Country",
      value: inputValue.country,
      width: 4,
    },
    {
      label: "Postal Code",
      value: inputValue.postalCode,
      width: 4,
    },
    {
      label: "About me",
      value: inputValue.about,
      width: 12,
    },
  ];

  return (
    <Box className="body-admin m-0 pt-5 bgr-admin" sx={{ minHeight: "100vh" }}>
      <Grid container spacing={1} className="ps-4 w-100">
        <Grid item xs={8}>
          <Box className="box">
            <HeaderTask
              bgr="badge-purple"
              title="Edit Profile"
              position="start"
              caption="Complete your profile"
            />
            <Grid container spacing={2} className="py-4 px-3">
              <Grid item xs={6}>
                <TextField
                  label="Company"
                  defaultValue="How2Code"
                  disabled
                  variant="standard"
                  className="w-100"
                />
              </Grid>
              {listInput.map((item, index) => {
                return (
                  <Grid key={index} item xs={item.width}>
                    <TextField
                      color="secondary"
                      label={item.label}
                      value={item.value}
                      onChange={() => setInputValue(sds)}
                      variant="standard"
                      className="w-100"
                    />
                  </Grid>
                );
              })}
              <Grid item xs={12} className="mt-3">
                <Button variant="contained" color="secondary">
                  UPDATE PROFILE
                </Button>
              </Grid>
            </Grid>
          </Box>
        </Grid>
        <Grid item xs={4}></Grid>
      </Grid>
    </Box>
  );
}
